import React, { useState } from 'react';
import '../css/Co';  // Import the external CSS file

const ContactForm = () => {
    const [formData, setFormData] = useState({
        email: '',
        mobile: '',
        city: '',
        pincode: '',
        country: '',
        description: '',
        productCode: '',
        productName: '',
        title: '',
        company: '',
        landline: '',
        state: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Form Data:', formData);
        // Handle form submission logic here
    };

    return (
        <div>
            <form onSubmit={handleSubmit} className="form">
                <fieldset className="main fieldset">
                    <legend className="legend">Contact Information</legend>
                    <label htmlFor="email">Email id:</label>
                    <input type="email" id="email" name="email" value={formData.email} onChange={handleChange} required className="input" />
                    <label htmlFor="mobile">Mobile No:</label>
                    <input type="text" id="mobile" name="mobile" value={formData.mobile} onChange={handleChange} required className="input" />
                    <label htmlFor="city">City:</label>
                    <input type="text" id="city" name="city" value={formData.city} onChange={handleChange} required className="input" />
                    <label htmlFor="pincode">Pin Code:</label>
                    <input type="text" id="pincode" name="pincode" value={formData.pincode} onChange={handleChange} required className="input" />
                    <label htmlFor="country">Country:</label>
                    <input type="text" id="country" name="country" value={formData.country} onChange={handleChange} required className="input" />
                    <label htmlFor="description">Description:</label>
                    <textarea id="description" name="description" value={formData.description} onChange={handleChange} rows="4" required className="textarea"></textarea>
                </fieldset>

                <fieldset className="prod fieldset">
                    <legend className="legend">Product Information</legend>
                    <label htmlFor="productCode">Product Code:</label>
                    <input type="text" id="productCode" name="productCode" value={formData.productCode} onChange={handleChange} required className="input" />
                    <label htmlFor="productName">Product Name:</label>
                    <input type="text" id="productName" name="productName" value={formData.productName} onChange={handleChange} required className="input" />
                </fieldset>
                <fieldset className="fieldset">
                    <label htmlFor="title">Title (Mr./Ms.):</label>
                    <input type="text" id="title" name="title" value={formData.title} onChange={handleChange} required className="input" />
                    <label htmlFor="company">Company Name:</label>
                    <input type="text" id="company" name="company" value={formData.company} onChange={handleChange} required className="input" />
                    <label htmlFor="landline">Land Line No:</label>
                    <input type="text" id="landline" name="landline" value={formData.landline} onChange={handleChange} className="input" />
                    <label htmlFor="state">State:</label>
                    <input type="text" id="state" name="state" value={formData.state} onChange={handleChange} required className="input" />
                    <br />
                    <br />
                    <center>
                        <button type="submit" className="submitButton">Send Enquiry</button>
                    </center>
                </fieldset>
            </form>
        </div>
    );
};

export default ContactForm;
